import React, { useState } from 'react';
import './GridEntry.scss'; // Update this import
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';

const GridEntry = () => { // Change name here
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({ name: '', driver: '', team: '' });

  const teams = ["McLaren", "Red Bull", "Ferrari", "Mercedes", "Aston Martin", "Alpine", "VCARB", "Haas", "Williams", "Audi"];

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <div className="grid-entry-container" id="contact" style={{ backgroundColor: '#FAFAF8', padding: '100px 10%' }}>
      <div className="main-content-area" style={{ display: 'flex', justifyContent: 'center' }}>
        <div className="f1-terminal" style={{ 
          backgroundColor: '#1E1E1E', 
          width: '100%', 
          maxWidth: '800px', 
          minHeight: '450px',
          borderRadius: '4px',
          padding: '40px',
          position: 'relative',
          boxShadow: '20px 20px 0px #FF7A1A'
        }}>

          {step === 1 ? (
            <div className="terminal-content">
              <h2 style={{ color: '#FF7A1A', fontFamily: 'monospace', marginBottom: '20px' }}>{'>'} MISSION_OBJECTIVE</h2>
              <p style={{ color: '#FAFAF8', lineHeight: '1.8', fontSize: '1.1rem', marginBottom: '30px' }}>
                Why F1? For me, software engineering is more than just code; itâ€™s about **performance architecture**. 
                Just as a race engineer monitors thousands of data points to find an extra tenth of a second, 
                I build systems that optimize for precision and reliability.
              </p>
              <button 
                onClick={() => setStep(2)}
                style={{ 
                  background: 'none', border: '1px solid #FF7A1A', color: '#FF7A1A', 
                  padding: '10px 20px', cursor: 'pointer', display: 'flex', alignItems: 'center', gap: '10px',
                  fontWeight: 800, fontFamily: 'monospace'
                }}
              >
                JOIN THE 2026 GRID <ArrowForwardIosIcon style={{ fontSize: '14px' }} />
              </button>
            </div>
          ) : (
            <div className="terminal-content">
              <button onClick={() => setStep(1)} style={{ background: 'none', border: 'none', color: '#6B7280', cursor: 'pointer', marginBottom: '20px', fontWeight: 800 }}>
                <ArrowBackIosNewIcon style={{ fontSize: '12px' }} /> BACK
              </button>
              <h2 style={{ color: '#FF7A1A', fontFamily: 'monospace', marginBottom: '30px' }}>{'>'} STRATEGIST_REGISTRATION</h2>

              <div style={{ display: 'grid', gap: '20px' }}>
                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <label style={{ color: '#6B7280', fontSize: '0.8rem', marginBottom: '5px', fontWeight: 800 }}>NAME</label>
                  <input name="name" onChange={handleInputChange} style={{ background: '#2C2C2C', border: 'none', color: '#FAFAF8', padding: '10px' }} />
                </div>

                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <label style={{ color: '#6B7280', fontSize: '0.8rem', marginBottom: '5px', fontWeight: 800 }}>2026 CHAMPION PREDICTION (DRIVER)</label>
                  <input name="driver" placeholder="Lando Norris?" onChange={handleInputChange} style={{ background: '#2C2C2C', border: 'none', color: '#FAFAF8', padding: '10px' }} />
                </div>

                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <label style={{ color: '#6B7280', fontSize: '0.8rem', marginBottom: '5px', fontWeight: 800 }}>CONSTRUCTORS SUPPORT</label>
                  <select name="team" onChange={handleInputChange} style={{ background: '#2C2C2C', border: 'none', color: '#FAFAF8', padding: '10px' }}>
                    <option value="">Select Team</option>
                    {teams.map(t => <option key={t} value={t}>{t}</option>)}
                  </select>
                </div>

                <button style={{ backgroundColor: '#FF7A1A', color: '#1E1E1E', fontWeight: 800, padding: '15px', border: 'none', cursor: 'pointer', marginTop: '10px', textTransform: 'uppercase' }}>
                  Submit to Pit Wall
                </button>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default GridEntry;
